    "2015-11-20T09:12:55.924462",nt"name": "ipia-1-year",nt"isopen": true,nt"url":
    null,nt"notes": "The U.S. Department of Labor has been working collaboratively
    with our state partners to identify several robust strategies that focus on the
    prevention of overpayments and will yield the highest impact in reducing UI improper
    payment rates.rnrnImproper Unemployment Insurance benefit payments are most likely
    to occur when:rnrnRecipients continue to claim benefits after returning to work;rnEmployers
    or their third party administrators do not submit timely or accurate separation
    information; andrnClaimants fail to register with the state's Employment Service
    (ES) as dictated by state law.rnEarlier this year, the Department actively intervened
    to encourage the ten states with the highest Employment Service registration error
    rates to focus on the issue. Senior DOL officials personally contacted these states
    to determine specific steps the states would take to address their error rates,
    and the Department provided targeted technical assistance.rnrnAs a result, dramatic
    progress is being made in this area, with a 23% reduction in improper payments to
    people who did not register with employment services agencies, including a more
    than 35% drop in eight states.",nt"license_title": "Creative Commons CCZero",nt"extras":
